The Clitheroe Kid was a long-running BBC radio comedy show featuring diminutive Northern comedian Jimmy Clitheroe in the role of a cheeky schoolboy, who lived with his family at 33 Lilac Avenue in an unnamed town in the North of England. The pilot show, pilot series, and 16 subsequent series totalled 290 episodes in all, broadcast between April 1957 and 13 August 1972
